import React from 'react';
import { NavLink } from 'react-router-dom';
import './NavigationItems.css'
// import { DropdownButton, Dropdown } from 'react-dropdown';
import Dropdown from 'react-bootstrap/Dropdown';

const navigationItems = (props) => {


    return (<React.Fragment>
        <ul className='NavItems'>
            <li><NavLink to='/'>Home</NavLink></li>
            <li><NavLink to='/jam-pads'>Jam pads</NavLink></li>
            <li><NavLink to='/bookings'>Bookings</NavLink></li>
        </ul>
        <select className='navDrop'>
            <option> <NavLink to='/'>Home </NavLink>  </option>
            <option><NavLink to='/jam-pads'>Jam pads</NavLink></option>
            <option><NavLink to='/bookings'>Bookings</NavLink></option>
        </select>

        <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
                Dropdown Button
  </Dropdown.Toggle>

            <Dropdown.Menu>
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
            </Dropdown.Menu>
        </Dropdown>

    </React.Fragment>);
};
export default navigationItems;
